# {{ISO 4217|hist=1|fund=1|UIC franc|from=1976|to=1989}}
====Usage notes====
This code was not moved to the table of historic currencies of {{w|ISO 4217}} until 2013, but the {{w|UIC franc}} was in practice replaced by the {{w|European Currency Unit}} in 1990, which was in turn replaced by the {{w|Euro}} in 1999.
